  console.log('checkbox3 = ',checkbox3);
  console.log('checkbox4 = ',checkbox4);

  return (
    <>
      <Checkbox handler={setCheckbox1} text='I read the term of the app' checked={false}/>
      <Checkbox handler={setCheckbox2} text='I accept the term of the app' checked={false}/>
      <Checkbox handler={setCheckbox3} text='I want to get the weekly news letter' checked={true}/>
      <Checkbox handler={setCheckbox4} text='I want to get sales and offers' checked={true}/>
    </>
  );
}

export default App;
